import { title } from "assets/jss/material-kit-react.js";

const productStyle = {
  section: {
    padding: "-100px 0",
    textAlign: "left",
  },
  title: {
    ...title,
    marginBottom: "1rem",
    marginTop: "30px",
    minHeight: "32px",
    textDecoration: "none",
    textAlign: "center",
  },
  description: {
    color: "#999",
    textAlign: "center",
  },
};

export default productStyle;
